		STATES[definition.name] = state;

		if (PENDING_DEFINITIONS[definition.name]) {
			var _penders = PENDING_DEFINITIONS[definition.name], i = _penders.length;

			while (i--) {
				this.register(_penders[i]);
			}

			PENDING_DEFINITIONS[definition.name] = null;
		}

